interface IconProps {
    width: number
    height: number
    viewBox: string
    path: string
}

export type IconName = 'arrow'

export const Icon = ({width, height, viewBox, path}: IconProps) => {
    return (
        <svg width={width} height={height} viewBox={viewBox} xmlns="http://www.w3.org/2000/svg">
            <path d={path}/>
        </svg>
    )
}
